import React from "react";
import { Routes, Route, Link } from "react-router-dom";

function Home() {
  return (
    <main className="homepage">
      <h1>Hola!!</h1>
      <p>Welcome to my Webpage</p>
      <p>Click the link below to contact me</p>
      <Link className="navigate" to="/">Home Page</Link>
      <Link className="navigate" to="/contact">Contact page</Link>
    </main>
  );
}

function Contact() {
  return (
    <main className="contact-me">
      <h1> Contact me here</h1>

      <Link className="navigate" to="/">Home Page</Link>
      <Link className="navigate" to="/">Contact Page</Link>
    </main>
  );
}

function SignUp() {
  return (
    <main className="sign-uo">
      <h1> Sign up to my weekly newsletter</h1>


    </main>
  );
}

function App() {
  return (
    <main className="main-container">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contact" element={<Contact />} >
            <Route path="/signup" element={<SignUp />} />
            </Route>
      </Routes>
    </main>
  );
}
export default App;
